
/*
    We are creating some ocean geometries

    RegionOcean: The ocean at the American Continent (we kept the part where our data is as the potential travel between coast using the Cape Horn)
    Ocean: The full ocean (worldwide)
    VoyageOcean: Same as the RegionOcean, but at around 100km from the shore. We will use this in order to calculate potential coast to coast travels.
    GridOcean: Only the N.America, covering the region of our data. We overlap it with the shore in order to also cover porta and rivers.

*/

CREATE TABLE IF NOT EXISTS context_data.oceans
(
    featurecla text COLLATE pg_catalog."default",
    scalerank bigint,
    geometry geometry(MultiPolygon,4326)
);

CREATE INDEX IF NOT EXISTS idx_oceans_geometry
    ON context_data.oceans USING gist (geometry);


INSERT INTO context_data.oceans (featurecla, scalerank, geometry)
VALUES ('RegionOcean', 0, ''),
('Ocean', 0, ''),
('VoyageOcean', 0, ''),
('GridOcean', 0, '');
